import * as React from 'react';
import { Box, Typography, Container } from '@mui/material';

const LandingPage = () => {
  return (
    <Container maxWidth="lg">
      <Box display="flex" justifyContent="space-between" alignItems="center" p={4}>
        {/* Left side: Header */}
        <Box flex={1} mr={2}> {/* mr is margin right for spacing between the columns */}
          <Typography variant="h2" component="h1" gutterBottom>
            Welcome to Our Startup
          </Typography>
        </Box>

        {/* Right side: Paragraph */}
        <Box flex={2}>
          <Typography variant="body1" color="textSecondary">
            Discover innovative solutions and dynamic services crafted to enhance your business growth. Our approach focuses on delivering exceptional value and ensuring that your strategic goals are met with precision and expertise. Join us on a journey of transformation and success.
          </Typography>
        </Box>
      </Box>
      <Box display="flex" justifyContent="center" alignItems="center" p={4}>
        <img src="constellation.gif" alt="Descriptive Alt Text" style={{ width: '100%', maxWidth: '600px' }} />
      </Box>
    </Container>
  );
}

export default LandingPage;
